script: |
  super -f text -I q4789.spq | sort > q4789.out

inputs:
  - name: q4789.spq
    data: |
      SELECT ALL - - col2, col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( - ( + - 3 ) * + + col1, col0 + - col2 );
  - name: tab2

outputs:
  - name: q4789.out
    data: |
      23	23
      40	40
      58	58
